Performance Interface The window.performance object is the main entry point for accessing the Performance API. It provides various methods and properties to measure and retrieve performance-related information. const perf = window.performance; Performance Timeline The Performance Timeline API allows developers to retrieve a detailed list of performance-related events and marks. It includes interfaces like PerformanceEntry, PerformanceMark, PerformanceMeasure, and PerformanceObserver. PerformanceEntry : Represents individual performance-related events, such as marks, measures, or resource timings. PerformanceMark : Allows developers to create custom timestamps in the performance timeline. PerformanceMeasure : Measures the duration between two marks or between a mark and the current time. performance.mark('start');
// Some code to measure
performance.mark('end');
performance.measure('duration', 'start', 'end');
const measure = performance.getEntriesByName('duration')[0];
console.log(measure.duration); Navigation Timing The Navigation Timing API provides detailed timing information about the loading of the document, from the initial request to the completion of the load event. This includes DNS lookup time, connection time, response time, and more. const timing = performance.timing;
const pageLoadTime = timing.loadEventEnd - timing.navigationStart;
console.log(`Page load time: ${pageLoadTime} ms`); Resource Timing The Resource Timing API provides timing information for each resource (e.g., scripts, images, stylesheets) loaded by the page. It allows developers to see how long each resource takes to fetch, which can be crucial for identifying slow resources. const resources = performance.getEntriesByType('resource');
resources.forEach(resource => { console.log(`Resource ${resource.name} took ${resource.duration} ms to load.`);
}); User Timing The User Timing API allows developers to create custom performance metrics by marking specific points in the code and measuring the time between them. This is particularly useful for measuring the performance of specific functions or user interactions. performance.mark('startWork');
// Perform some work
performance.mark('endWork');
performance.measure('workDuration', 'startWork', 'endWork');
const workDuration = performance.getEntriesByName('workDuration')[0].duration;
console.log(`Work duration: ${workDuration} ms`); PerformanceObserver The PerformanceObserver API allows developers to observe and respond to performance events as they occur. This is useful for tracking performance in real-time. const observer = new PerformanceObserver((list) => { const entries = list.getEntries(); entries.forEach(entry => { console.log(`Observed ${entry.entryType} entry:`, entry); });
}); observer.observe({ entryTypes: ['mark', 'measure'] });

