Collect Performance Data Use the performance.getEntriesByType('resource') method to gather data about the resources loaded on the page. This will give you an array of PerformanceResourceTiming objects, each containing detailed timing information for a resource. const resources = performance.getEntriesByType('resource'); Extract Timing Information For each resource, extract the relevant timing data, such as startTime, responseEnd, and duration. const timings = resources.map(resource => ({ name: resource.name, startTime: resource.startTime, duration: resource.duration, requestStart: resource.requestStart, responseEnd: resource.responseEnd,
})); Sort Resources by Start Time To create a waterfall diagram, resources should be displayed in the order they were requested. Sort the resources by startTime. timings.sort((a, b) => a.startTime - b.startTime); Visualize the Data Use an HTML <canvas>, SVG, or a charting library like D3.js to draw the waterfall diagram. Each resource can be represented as a horizontal bar starting at startTime and extending to responseEnd. Here’s a basic example using HTML and a <canvas> element: <canvas id="waterfall" width="800" height="400"></canvas>
<script> const canvas = document.getElementById('waterfall'); const ctx = canvas.getContext('2d'); const rowHeight = 20; const startX = 100; // Starting X position for the bars const scale = 2; // Scale factor for converting time to pixels timings.forEach((timing, index) => { const y = index * rowHeight; const width = timing.duration * scale; const x = timing.startTime * scale + startX; // Draw the background bar for the total duration ctx.fillStyle = '#ccc'; ctx.fillRect(x, y, width, rowHeight - 2); // Draw the name of the resource ctx.fillStyle = '#000'; ctx.fillText(timing.name, 10, y + rowHeight / 2); });
</script> Customize and Enhance Labels : Add labels for each resource to show the resource name and duration. Color Coding : Use different colors to represent different types of resources (e.g., HTML, CSS, JS). Tooltips : Add tooltips to display detailed timing information when hovering over each bar. Consider Using a Library For more complex and feature-rich waterfall diagrams, consider using a library like D3.js or Chart.js . These libraries can help manage scales, axes, tooltips, and interactions more effectively.
